import React from "react";
import styled from "styled-components";

export const LayoutContainer = styled.div`
	position:relative;
	min-width:100vw;
	min-height:100vh;
	border: 3px solid yellow;
	display: grid;
	grid-template-rows: 10vh 90vh;
	grid-template-columns: 5vw 95vw;
`;
